import{_ as e,o as a,c as o,O as r}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 33.2-1010 Use and disposition of residue parcels of land.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/33.2-1010.md","filePath":"vacode/33.2-1010.md"}'),s={name:"vacode/33.2-1010.md"},i=r('<h1 id="§-33-2-1010-use-and-disposition-of-residue-parcels-of-land" tabindex="-1">§ 33.2-1010 Use and disposition of residue parcels of land. <a class="header-anchor" href="#§-33-2-1010-use-and-disposition-of-residue-parcels-of-land" aria-label="Permalink to &quot;§ 33.2-1010 Use and disposition of residue parcels of land.&quot;">​</a></h1><p>The Commissioner of Highways may lease, sell, or exchange such residue parcels of land upon such terms and conditions as in the judgment of the Commissioner of Highways may be in the public interest, provided, however, that the Commissioner of Highways shall not use such parcels for any commercial purpose. The Commissioner of Highways may lease, sell, or exchange such residue parcels of land as may have been acquired under the provisions of the Transportation Development and Revenue Bond Act (§ <a href="http://law.lis.virginia.gov/vacode/33.2-1700/" target="_blank" rel="noreferrer">33.2-1700</a> et seq.), upon such terms and conditions as in the judgment of the Commissioner of Highways may be in the public interest. The Commissioner of Highways may lease such parcels of land as may have been acquired under the provisions of § <a href="http://law.lis.virginia.gov/vacode/33.2-1005/" target="_blank" rel="noreferrer">33.2-1005</a> in the event the former owner fails to make the request authorized under § <a href="http://law.lis.virginia.gov/vacode/33.2-1005/" target="_blank" rel="noreferrer">33.2-1005</a> to persons other than the former owner, upon such terms and conditions as in the judgment of the Commissioner of Highways may be in the public interest. The provisions of Articles 1 (§ <a href="http://law.lis.virginia.gov/vacode/33.2-900/" target="_blank" rel="noreferrer">33.2-900</a> et seq.) and 2 (§ <a href="http://law.lis.virginia.gov/vacode/33.2-908/" target="_blank" rel="noreferrer">33.2-908</a> et seq.) of Chapter 9 shall not be construed to apply to the disposition of land authorized in this section.</p><p>Code 1950, § 33-117.4; 1960, c. 546; 1970, c. 322, § 33.1-93; 2014, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0805" target="_blank" rel="noreferrer">805</a>.</p>',3),t=[i];function n(l,d,h,c,p,f){return a(),o("div",null,t)}const _=e(s,[["render",n]]);export{m as __pageData,_ as default};
